INSERT INTO `t_td_colitem` VALUES ('20159', 159, '2', '表', 'T_ZJ_BILL_SOURCESET', NULL, NULL, '中', NULL, '付俊', '资金监控', '资金监控项目组', '总账管理', '总账项目组', '吴健', '否', '否', NULL, NULL, NULL, '##功能\n根据SETID删除来源数据.\n\n##相关表：\nT_ZJ_BILL_SOURCESET   资金制证其他分录来源设置表\n\n##返回字段：\n无\n\n##删除条件：\nSETID 设置ID\n\n##参考SQL：\nDELETE T_ZJ_BILL_SOURCESET WHERE SETID=:SETID', NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `t_td_colitem` VALUES ('20160', 160, '2', '表', 'T_ZJ_REFMODEL', NULL, NULL, '中', NULL, '付俊', '资金监控', '资金监控项目组', '总账管理', '总账项目组', '吴健', '否', '否', NULL, NULL, NULL, '##功能\n查询资金支付单据信息.\n\n##相关表：\nECP_EF_TYPE   系统实体类型\nT_ZJ_REFMODEL 资金参考模型\n\n##返回字段：\nA.TYPEID, A.CAPTION\n\n##查询条件：\n无\n\n##参考SQL：\nSELECT A.TYPEID, A.CAPTION FROM ECP_EF_TYPE A, T_ZJ_REFMODEL B \n WHERE B.TYPEID = A.UPPERTYPEID \n AND NVL(A.STOPED, 0) = 0 AND NVL(B.TYBZ, 0) = 0', NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `t_td_colitem` VALUES ('20161', 161, '2', '表', 'T_PS_ZFSPGJ T_PS_PREBILL', NULL, NULL, '中', NULL, '付俊', '资金监控', '资金监控项目组', '总账管理', '总账项目组', '吴健', '否', '否', NULL, NULL, NULL, '##功能\n查询资金支付单据信息.\n\n##相关表：\nT_PS_ZFSPGJ    支付审批轨迹表\nT_PS_PREBILL   预制证凭证单据和实体关系表\n\n##返回字段：\nB.ACTIVITYDEFID,B.POSTNAME,B.YHMC,B.RESID\n\n##查询条件：\nYZPZBILLID 预制凭证BILLID\n\n##参考SQL：\nSELECT B.ACTIVITYDEFID,B.POSTNAME,B.YHMC,B.RESID \n     FROM T_PS_ZFSPGJ B,T_PS_PREBILL E \n     WHERE B.ZJZFID=E.ZJZFID AND E.YZPZBILLID = :UNINO\n        AND RESID IS NOT NULL \n           ORDER BY B.DODATE', NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `t_td_colitem` VALUES ('20162', 162, '2', '表', 'T_PS_KMWD', NULL, NULL, '中', NULL, '付俊', '资金监控', '资金监控项目组', '总账管理', '总账项目组', '吴健', '否', '否', NULL, NULL, NULL, '##功能\n查询科目维度.\n\n##相关表：\nT_PS_KMWD 科目维度对应\n\n##返回字段：\nDIMID\n\n##查询条件：\nHKONT  SAP科目编号\n\n##参考SQL：\nSELECT DIMID FROM T_PS_KMWD WHERE HKONT IN (:HKONT)', NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
