INSERT INTO `t_td_colitem` VALUES ('20198', 198, '2', '表', 'T_ECM_DOCTYPEREF，T_ELECTRONICDOC ，T_ELECTRONICDOCFOLDER ，ATTACHMENT_SUMMARY ', NULL, NULL, '低', NULL, NULL, '内容管理', 'YG ECM 项目组', '产权管理', '产权管理项目组', '董晓辉', '否', '否', NULL, NULL, NULL, '获取附件备注信息\nString sql = \"SELECT DISTINCT F.RESID            \"\n				+ \"  FROM T_ECM_DOCTYPEREF A, T_ELECTRONICDOC D, T_ELECTRONICDOCFOLDER E,ATTACHMENT_SUMMARY F\"\n				+ \" WHERE D.FOLDERID = E.FOLDERID                                       \"\n				+ \"   AND A.BILLFILEID = D.BILLFILEID  AND E.JCRRESFOLDERID = F.YWKEY                                 \";\n		if (WFL.equals(newFlid)) {\n			sql = sql\n					+ \"   AND A.ORIGINALDOCTYPEID != :NEWFLID                     \";\n		} else {\n			sql = sql\n					+ \"   AND A.ORIGINALDOCTYPEID = :NEWFLID                        \";\n		}', NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
