INSERT INTO `t_td_colitem` VALUES ('20208', 208, '2', '表', 'ZWITEMSYW', '', '', '高', 'com.ygsoft.gris.mapp.std.account.provider.dataaccess.query.IKmDataService', '', '总账管理', '总账项目组', '资产管理', '资产价值项目组', '覃梦', '否', '否', '', '##描述：\n多条件查询科目数据。\n\n##方法名：\nString findByMultiCondition(final String accountDataContext, final String condition);\n\n##参数：\n1、accountDataContext  登录上下文，格式：\n{\n    \"\"invokeCode\"\": \"\"调用权限码\"\",\n    \"\"loginCompid\"\": \"\"登录单位ID\"\",\n    \"\"loginCompName\"\": \"\"\"\",\n    \"\"loginUserDspName\"\": \"\"\"\",\n    \"\"ipAddress\"\": \"\"\"\",\n    \"\"ownerAppId\"\": \"\"调用权限码\"\",\n    \"\"loginDate\"\": \"\"/Date(1451577600000+0800)/\"\",\n    \"\"tokenId\"\": \"\"\"\",\n    \"\"callMkjc\"\": \"\"HWSW\"\",\n    \"\"callClassName\"\": \"\"\"\",\n    \"\"retType\"\": 0,\n    \"\"retUnZip\"\": 1\n}\n\n属性说明：\nloginCompid : 登录单位，必填。\ncallMkjc : 调用方模块或系统简称，本属性为必填项。\ncallClassName : 调用方的类路径及名称，本属性非必填项，但能填的尽量填，以便后续出现问题的时候跟进处理。\ninvokeCode : 调用权限码,本属性目前非必填项，为以后扩展预留。\nretType : 输出结果返回数据格式。0 表示以 json 格式返回数据;目前固定填0。\nretUnZip : 是否返回非压缩格式。1 是 0 否；目前固定填1。\n\n2、condition 查询参数 格式如下：\n   {\n     \"ywdate\": \"业务时间字符串（格式：yyyy-MM-dd HH：mm:ss）。不填写默认为当前时间\", \n     \"bookId\": \"账簿ID。不填写默认为0\",\n     \"compid\": \"策略单位ID，不传默认取登录上下文中的登录单位ID\",\n     \"stime\":\"科目启用时间字符串（格式：yyyy-MM-dd HH:mm:ss）。非必填\",\n     \"etime\":\"科目停用时间字符串（格式：yyyy-MM-dd HH:mm:ss）。非必填\",\n     \"code\":\"科目代号前缀模糊匹配。多个CODE间以,分隔。非必填\",\n     \"codes\":\"科目代号IN查询。多个CODE间以,分隔。非必填\",\n     \"itemcode\":\"科目itemcode前缀模糊匹配。多个itemcode间以,分隔。非必填\",\n     \"itemcodes\":\"科目itemcodeIN查询。多个itemcode间以,分隔。非必填\",\n     \"leaf\":\"是否叶节点，是：1,2。否：0。非必填\"\n   }\n\n##返回结果： ZwitemsywVO列表JSON字符串\nZwitemsywVO对象类路径：com.ygsoft.gris.account.service.settings.ZwitemsywVO\nZwitemsywVO对象属性说明如下：\n科目编码 . String itemcode;\n启用时间 . Date stime;\n科目标题 . String caption;\n科目GID . Long flgid;\n科目IID . Long iid;\n块编码 . String blockcode;\n位置编码 . String position;\n级数 . int itemlevel;\n底层标志 . int leaf;\n用户编码 . String code;\n助记码 .