INSERT INTO `t_td_colitem` VALUES ('20253', 253, '2', '表', 'COMPANYINFO', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '内容管理', 'YG ECM项目组', NULL, NULL, NULL, NULL, NULL, NULL, 'RepTemplateQueryDaoConst\n\"SELECT T.TEMPLATEID,\")\n		.append(\"       T.TEMPLATENAME,\")\n		.append(\"       T.YWKEY,\")\n		.append(\"       T.STARTDATE,\")\n		.append(\"       T.ENDDATE,\")\n		.append(\"       T.COMPID,\")\n		.append(\"       T.S_LAST_TIME   SLASTTIME,\")\n		.append(\"       T.S_CREATE_TIME SCREATETIME\")\n		.append(\"  FROM T_FIN_REP_TEMPLATE T,\")\n		.append(\"       (SELECT COMPID, COMPNAME, PCOMPID\")\n		.append(\"          FROM COMPANYINFO C\")\n		.append(\"        CONNECT BY PRIOR C.PCOMPID = C.COMPID\")\n		.append(\"         START WITH COMPID = :COMPID) O\")\n		.append(\" WHERE T.COMPID = O.COMPID\")\n		.append(\"   AND T.TEMPLATETYPE = :TEMPLATETYPE\")\n		.append(\"   AND T.STARTDATE <= TO_DATE(:DATE, \'YYYY-MM-DD\')\")\n		.append(\"   AND T.ENDDATE > TO_DATE(:DATE, \'YYYY-MM-DD\')\"', NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
